import React from 'react';
import './Moon.css';
import { planets, moons } from '../../constats'

const Moon = () => {
    console.log(moons)
    return (
        <div className='block'>
            {planets.map((planet) => (
                <div className='planet' key={planet.id}>
                    {planet.title}
                    <div>{
                            planet.moons.map((moon) => (
                                <div key={moon.id}>{moon.title}</div>
                            ))
                        }</div>
                </div>
            ))}
            {/* {moons.map((moon) => (
                <div key={moon.id}>{moon.title}</div>
            ))} */}
        </div>
    )
}

export default Moon;
